import React from "react";
import HeadLine from "../../component/Headline/Headline";
import { Container } from "react-bootstrap";
import logo from "../../assets/logo/logo.jpg";
const Contact = () => {
    return (
        <div className="contact">
            <Container>
                <HeadLine headline={"Liên hệ với chúng tôi"}></HeadLine>
                <div className="contact-information">
                    <h2>Shaman Tea</h2>
                    <ul>
                        <li>
                            <span>Địa chỉ: </span>330A/13 An Phú Tây - Hưng Long - Ấp1 - Xã An Phú Tây - Huyện Bình Chánh - TP. Hồ Chí Minh
                        </li>
                        <li>
                            <span>Số điện thoại: </span>3123-123-123
                        </li>
                        <li>
                            <span>Phản ánh: </span>0965-210-839
                        </li>
                    </ul>
                    <img src={logo} alt="" />
                </div>
            </Container>
        </div>
    );
};

export default Contact;
